  [],\n\t\"num_tags\": 0,\n\t\"name\": \"environmental-sensitivity-index-esi-atlas-georgia-maps-and-geographic-information-systems-data-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps for the shoreline of Georgia. ESI data characterize
  estuarine environments and wildlife by their sensitivity to spilled oil. The ESI
  data include information for three main components: shoreline habitats; sensitive
  biological resources; and human-use resources. This atlas was developed to be utilized
  within desktop GIS systems and contains GIS files and related D-base files. Associated
  files include MOSS (Multiple Overlay Statistical System) export files, .PDF maps,
  and detailed user guides and metadata.nnThe intertidal habitats of Georgia were
  originally mapped during overflights conducted in the fall of 1984. They were updated
  onto 1:24,000 U.S. Geological Survey (USGS) topographic maps by an experienced coastal
  geologist in January 1997 using recent vertical aerial photographs from 1993-1996
  at various scales. Portions of the coast were flown in February 1997 to verify the
  photo- interpretation. The biological and human-use resources data were compiled
  by regional biologists in 1996 and 1997.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
